// Search.js
import React from "react";
import { ProductAirpods } from "../Products/ProductAirpods/ProductAirpods";

const Search = ({ searchInput }) => {
  const filteredProducts = ProductAirpods.filter((product) =>
    product.name.toLowerCase().includes(searchInput.toLowerCase())
  );

  return (
    <div>
      {filteredProducts &&
        filteredProducts.map((product) => (
          // Arama sonuçlarını burada görüntüleyebilirsiniz
          // Örneğin:
          <div key={product.id}>
            <h3>{product.name}</h3>
            <p>Price: {product.price}</p>
            {/* Diğer ürün bilgilerini burada görüntüleyebilirsiniz */}
          </div>
        ))}
    </div>
  );
};

export default Search;
